import React, { useState, useEffect } from "react";
import Papa from "papaparse"; // Add this import
import GrapherWrapper from "./GrapherWrapper";
import "./App.css";

// Helper function to load CSV data
const loadCSVData = (csvFilePath) => {
  return new Promise((resolve, reject) => {
    Papa.parse(csvFilePath, {
      download: true,
      complete: (result) => {
        resolve(result.data);
      },
      error: (error) => reject(error),
    });
  });
};

function App() {
  const [userId, setUserId] = useState("");
  const [levels, setLevels] = useState(1);
  const [graphData, setGraphData] = useState({ nodes: [], edges: [] });
  const [selectedNode, setSelectedNode] = useState(null);
  const [ratingsData, setRatingsData] = useState([]);
  const [userBias, setUserBias] = useState({});
  const [itemBias, setItemBias] = useState({});
  const [globalMean, setGlobalMean] = useState(0);

  useEffect(() => {
    // Load CSV when the component mounts
    loadCSVData("sample_user_ratings.csv")
      .then((data) => {
        console.log(data)
        setRatingsData(data);
        // Process CSV data
        processRatingsData(data);
      })
      .catch((error) => console.error("Error loading CSV:", error));
  }, []);

  const processRatingsData = (data) => {
    const ratingsDf = data;
    const userIds = [...new Set(ratingsDf.map((row) => row.user_id))];
    const productIds = [...new Set(ratingsDf.map((row) => row.product_id))];

    const userToIdx = Object.fromEntries(userIds.map((user, i) => [user, i]));
    const productToIdx = Object.fromEntries(productIds.map((prod, i) => [prod, i]));

    // Compute Global Mean, Biases, and Residual Matrix
    const globalMean = ratingsDf.reduce((acc, row) => acc + parseFloat(row.rating), 0) / ratingsDf.length;
    setGlobalMean(globalMean);

    const userBias = ratingsDf.reduce((acc, row) => {
      acc[row.user_id] = acc[row.user_id] || 0;
      acc[row.user_id] += parseFloat(row.rating);
      return acc;
    }, {});
    setUserBias(userBias);

    const itemBias = {}; // Compute item biases (similar to userBias logic)

    // Compute user-item matrix
    const userItemSparse = [];
    ratingsDf.forEach((row) => {
      const userIdx = userToIdx[row.user_id];
      const productIdx = productToIdx[row.product_id];
      userItemSparse.push({
        userIdx,
        productIdx,
        ratingResidual: parseFloat(row.rating) - globalMean, // example residual
      });
    });

    // SVD logic here (simplified for brevity)
    const svd = new SomeSVDImplementation(); // You'll need to add your actual SVD logic here.
  };

  // Your recommendation logic can be called in the form submit handler as before

  function generateMockRecommendations(userId, levels) {
    const nodes = [];
    const edges = [];

    const userNodeId = `user-${userId}`;
    nodes.push({ id: userNodeId, label: `User ${userId}`, level: 0 });

    const recommendedProducts = ["ProdA", "ProdB", "ProdC"];
    recommendedProducts.forEach((prod) => {
      nodes.push({ id: prod, label: `${prod} (Recommended)`, level: 1 });
      edges.push({ source: userNodeId, target: prod });

      if (levels > 1) {
        const simItems = [`${prod}-Sim1`, `${prod}-Sim2`];
        simItems.forEach((sim) => {
          nodes.push({ id: sim, label: sim, level: 2 });
          edges.push({ source: prod, target: sim });
        });
      }
    });

    return { nodes, edges };
  }

  function handleSubmit(e) {
    e.preventDefault();
    if (!userId) return;

    const data = generateMockRecommendations(userId, levels);
    setGraphData(data);
    setSelectedNode(null);
  }

  const handleNodeClick = React.useCallback((nodeId) => {
    setSelectedNode(nodeId);
  }, []);

  return (
    <div className="app-container">
      <h1>Interactive Recommendation Graph</h1>

      <form onSubmit={handleSubmit}>
        <label htmlFor="userId">User ID: </label>
        <input
          id="userId"
          type="text"
          value={userId}
          onChange={(e) => setUserId(e.target.value)}
          required
        />

        <label htmlFor="levels"> # of levels: </label>
        <input
          id="levels"
          type="number"
          min="1"
          value={levels}
          onChange={(e) => setLevels(Number(e.target.value))}
        />

        <button type="submit">Generate Graph</button>
      </form>

      <div className="graph-section">
        <GrapherWrapper
          nodes={graphData.nodes}
          edges={graphData.edges}
          onNodeClick={handleNodeClick}
        />
      </div>

      {selectedNode && (
        <div className="detail-section">
          <h2>Node Details</h2>
          <p>You clicked on: <strong>{selectedNode}</strong></p>
        </div>
      )}
    </div>
  );
}

export default App;
